    GlobalEvents = Map.map_event_group;

    Map.unlimited_stamina = true; -- no other enemies than the boss here.

    _CreateCharacters();
    _CreateObjects();
    --_CreateEnemies();

    -- Set the camera focus on hero
    Map:SetCamera(hero);
    -- This is a dungeon map, we'll use the front battle member sprite as default sprite.
    Map.object_supervisor:SetPartyMemberVisibleSprite(hero);

    _CreateEvents();
    _CreateZones();

    -- Add clouds overlay
    Map:GetEffectSupervisor():EnableAmbientOverlay("img/ambient/clouds.png", 5.0, 5.0, true);
end

-- the map update function handles checks done on each game tick.
function Update()
    -- Check whether the character is in one of the zones
    _CheckZones();
end

-- Character creation
function _CreateCharacters()
    -- Default hero and position
    hero = CreateSprite(Map, "Bronann", 30, 22);
    hero:SetDirection(hoa_map.MapMode.NORTH);
    hero:SetMovementSpeed(hoa_map.MapMode.NORMAL_SPEED);

    -- Load previous save point data
    local x_position = GlobalManager:GetSaveLocationX();
    local y_position = GlobalManager:GetSaveLocationY();
    if (x_position ~= 0 and y_position ~= 0) then
        -- Use the save point position, and clear the save position data for next maps
        GlobalManager:UnsetSaveLocation();
        -- Make the character look at us in that case
        hero:SetDirection(hoa_map.MapMode.SOUTH);
        hero:SetPosition(x_position, y_position);
    end

    Map:AddGroundObject(hero);
end

-- The boss map sprite
local wolf = {};

local orlinn = {};

function _CreateObjects()
    local object = {}
    local npc = {}

    -- save point
    Map:AddSavePoint(58, 87, hoa_map.MapMode.CONTEXT_01);
    
    -- The boss map sprite, placed for final battle
    wolf = CreateSprite(Map, "Fenrir", 42, 63);
    wolf:SetMovementSpeed(hoa_map.MapMode.VERY_FAST_SPEED);
    wolf:SetDirection(hoa_map.MapMode.SOUTH);
    Map:AddGroundObject(wolf);

    -- Orlinn, waiting...
    orlinn = CreateSprite(Map, "Orlinn", 42, 58);
    orlinn:SetDirection(hoa_map.MapMode.NORTH);
    orlinn:SetMovementSpeed(hoa_map.MapMode.NORMAL_SPEED);
    Map:AddGroundObject(orlinn);
end

-- Creates all events and sets up the entire event sequence chain
function _CreateEvents()
    local event = {};
    local dialogue = {};
    local text = {};

    -- Triggered events
    event = hoa_map.MapTransitionEvent("to forest cave 2", "dat/maps/layna_forest/layna_forest_cave2.lua", "from layna forest crystal");
    EventManager:RegisterEvent(event);
end

-- Create the different map zones triggering events
function _CreateZones()
    -- N.B.: left, right, top, bottom
    to_forest_cave2_zone = hoa_map.CameraZone(28, 33, 23, 25, hoa_map.MapMode.CONTEXT_01);
    Map:AddZone(to_forest_cave2_zone);

    wolf_battle_zone = hoa_map.CameraZone(38, 46, 63, 66, hoa_map.MapMode.CONTEXT_01);
    Map:AddZone(wolf_battle_zone);
end

-- Check whether the active camera has entered a zone. To be called within Update()
function _CheckZones()
    if (to_forest_cave2_zone:IsCameraEntering() == true) then
        hero:SetMoving(false);
        EventManager:StartEvent("to forest cave 2");
    end
end

